import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';

import 'bootstrap/dist/css/bootstrap.min.css';

import Home from './pages/Home';
import About from './pages/About';

function Contact() {
  return <h1 className="text-center">Contact Page</h1>;
}

function Services() {
  return <h1 className="text-center">Services Page</h1>;
}


function App() {
  return (
    <div className="container mt-5">
      <nav className="navbar navbar-expand navbar-dark bg-primary mb-4">
        <Link className="navbar-brand" to="/">My React App</Link>
        <div className="navbar-nav">
          <Link className="nav-link" to="/">Home</Link>
          <Link className="nav-link" to="/about">About</Link>
          <Link className="nav-link" to="/services">Services</Link>
          <Link className="nav-link" to="/contact">Contact</Link>
        </div>

      </nav>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/services" element={<Services />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>

    </div>
  );
}

export default App;
